import React from 'react';
import './static/signup.css';

function Register(){
	return (

			<div className="wrapper fadeInDown">
			  <div id="formContent">
			    {/* <!-- Tabs Titles */}

			    <h2 className="active"> Sign In </h2>
			    <h2 className="inactive underlineHover">Sign Up </h2>

			    {/* Icon */}

			    <div className="fadeIn first">
			      <img src="http://danielzawadzki.com/codepen/01/icon.svg" id="icon" alt="User Icon" />
			    </div>

			    {/* Login Form */}

			    <form>
			      <input type="text" id="login" className="fadeIn second" name="login" placeholder="username"  required/>
			      <input type="text" id="login" className="fadeIn second" name="login" placeholder="email" required/>
			      <input type="text" id="password" className="fadeIn third" name="login" placeholder="password" required/>
			      <input type="submit" className="fadeIn fourth" value="Log In" />
			    </form>

			    {/* Remind Passowrd */}

			    <div id="formFooter">
			      <a className="underlineHover" href="#">Forgot Password?</a>
			    </div>

			  </div>
			</div>

		);
}

export default Register
